(92,	'20% Off Cocktails',	'The Pangolin is a one of a kind lifestyle destination with a focus on the community spirit and connecting people through good food. The purpose-built complex is an extension of The Els Club in Dubai Sports City and is made up of The Lowlands, a ground floor restaurant and casual bar that is open all day for breakfast, lunch and dinner, as well as a deli with home-grown produce, and on-site bakery. The Highlands, Pangolin’s first-floor restaurant, stunning bar, and terrace with open BBQ is also the perfect place to relax and unwind with friends and family. Inspired by family feasting and traditional cooking methods, The Pangolin works with local farmers and sustainable produce to serve a menu with real heart and soul and is consistently good value for all.\r\n\r\nThe Pangolin Restaurant & Lounge are offering 20% off cocktails (Tues-Thurs).',	5,	'vPm7BVY8tAsL0OJVAGwHzRyq3sFn6xoodKpSJSTr.png',	52,	'Present ID to redeem discount',	'2021-01-18 10:10:33',	1,	'2021-01-18 10:10:33',	'2021-02-18 06:45:54'),
