(106,	'Special Discount',	'No mess, no stress! The Movers DXB help people and businesses move their goods from one place to another. They offer all-inclusive services for relocation like packing, loading, moving, unloading, unpacking, arranging of items to be shifted. Additional services may include cleaning services for houses, offices or warehousing facilities. They are specialized in providing quality-oriented services. They have well experienced packers & movers to provide best services.\r\n\r\nThe Movers DXB are offering a special discount to all TDG members. Please quote TDG at the time of booking.',	13,	'uQDLNY8MD5JEvP6Ks8LpjNuTGJrfhkezRyN2usLQ.png',	81,	'Present ID to redeem discount',	'2021-01-21 06:34:05',	1,	'2021-01-21 06:34:05',	'2021-02-18 07:23:02'),
(107,	'Ladies Night Package',	'Work your way around the world amid the bustle and energy of this eclectic dining destination. Sample sizzling dishes and bold flavours from Asia at Kim’s Korean, Lucy Wong’s, Momo San and Chatakana; indulge in Italian favourites at Mario’s and Arabic delicacies at Ali’s. Drink and dine with views of the Burj Khalifa and Dubai’s stunning skyline.\r\n\r\n24th St. World Street Food are offering an exclusive TGD Ladies Night, Saturday\'s through Monday\'s.\r\n\r\nAED109 – one main course and unlimited wine from 8pm to 10pm             \r\nAdd AED49 to enjoy dessert and unlimited house spirits; beer from 8pm to 10pm',	5,	'VwAg3yaPTy3xAZLVzok59iPgKbkOIEr75qA1hBRe.png',	93,	'Present ID to redeem discount',	'2021-01-21 12:20:55',	1,	'2021-01-21 12:20:55',	'2021-02-18 07:24:37'),
