(109,	'Happy Hour All Night',	'Please note this venue is currently closed.\r\n\r\nExperience the unique drinking culture of Japan and explore its 100-year-old history at Nippon Bottle Company, where the legacy lives on. Discover the unmistakable textures and blends of Japanese beers and whiskies for a journey of flavours.\r\n\r\nNippon Bottle Company are offering an exclusive Ladies Night for all TDG members, Saturday\'s through Monday\'s.\r\n\r\nHappy hour all night @ AED 29 per drink (house beverages only)',	5,	'zeRXsbnZnQp9mdRhLfJg5mxZ0RMjSIbA4UJuTZgA.png',	95,	'Present ID to redeem discount',	'2021-01-21 12:33:56',	1,	'2021-01-21 12:33:56',	'2021-02-18 07:28:55'),
(110,	'Ladies Night Package',	'Aptly named for its prime location between Dubai’s soaring skyscrapers, View offers panoramic vistas of the skyline. Whet your appetite with an array of delicious drinks and indulge with bites and delights from Jones the Grocer. Watch the sunset Emirati style, with an aromatic shisha.\r\n\r\nView are offering an exclusive Ladies Night to all TDG members, Saturday\'s through Monday\'s.\r\n\r\nAED109 – one main course and shisha            \r\nAdd AED99 to enjoy unlimited wine for two hours',	5,	'AGiH1VdCqdEywn8ZzmjiKq2CtqfalD6RdlZVYGGX.png',	94,	'Present ID to redeem discount',	'2021-01-21 12:38:30',	1,	'2021-01-21 12:38:30',	'2021-02-18 07:35:23'),
(122,	'15% Off Merchandise',	'Pet Parents UAE is a community founded in July 2019 by a dog mum wanting to form new friendships for herself and her dogs. From events to simple meet ups they have always had dog parents of Dubai in their best interests, alongside their local dog organtisations raising just over 10,000AED in 1 year alone.\r\nTheir merchandise is designed to help you and your family stand out from the crowd but also be recognized as part of a community. With every purchase made they will donate 15% towards a different organizations vet bill each month. Like their events, they will always thrive to give you the best and most friendliest service.\r\n\r\nPet Parents UAE are offering 15% off for all TDG members.',	3,	'iLxpAoXeV1pBKpNukPJoX4q8UkO7ei34NyR1kZez.png',	98,	'Use code TDG15 at checkout',	'2021-01-25 07:18:09',	1,	'2021-01-25 07:18:09',	'2021-02-18 07:37:45'),
